import React, { Component } from 'react';

class PrivateRoute extends Component {

    privateRoute = ({ auth, component: Component, ...rest }) => {
        return (
            <Route {...rest} render={ 
                props => auth ? 
                (<Component {...props}/>
                ) : (
                <Redirect to="/" />
                )}
            />
        );
    }
}

export default PrivateRoute;
